import logo from './logo.svg';
import React, {Fragment} from 'react';
import './App.css';
import Dashboard from './Containers/Dashboard/Dashboard'
import ButtonAppBar from './Components/NavBar/NavBar'
import {DashboardTest} from './Containers/Dashboard/Dashboard'
import Counter from './Components/Counter/Counter'
import GetUser from './Users/GetUser/GetUser'
import GetUser2 from './Users/GetUser/GetUser2'
import PostUser from './Users/PostUser/PostUser'
import DeleteUser from './Users/DeleteUser/DeleteUser'
import LoginUser from './Users/PostUser/LoginUser';

function App() {
  return (
    <>
    <ButtonAppBar/>
    <GetUser2/>
    <PostUser/>
    <DeleteUser/>
    <LoginUser/>
    </>
  );
}

export default App;
